      out.write("\t\t\t\t\t\t\t<div class=\"terms_box\">\t\t\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t\t\t\t<!-- 네이버 이용약관 동의 -->\r\n");
      out.write("\t\t\t\t\t\t\t<div class=\"article\">\r\n");
      out.write("\t\t\t\t\t\t\t\t<h3 class=\"article__title\">제 1 조 (목적)</h3>\r\n");
      out.write("\t\t\t\t\t\t\t\t<p class=\"article__text\">이 약관은 네이버 주식회사 (\"회사\" 또는 \"네이버\")가 제공하는 네이버 및 네이버 관련 제반 서비스의 이용과 관련하여 회사와 회원과의 권리, 의무 및 책임사항, 기타 필요한 사항을 규정함을 목적으로 합니다.</p>\r\n");
      out.write("\t\t\t\t\t\t\t</div>\r\n");
      out.write("\t\t\t\t\t\t\t<div class=\"article\">\r\n");
      out.write("\t\t\t\t\t\t\t\t<h3 class=\"article__title\">제 2 조 (정의)</h3>\r\n");
      out.write("\t\t\t\t\t\t\t\t<p class=\"article__text\">이 약관에서 사용하는 용어의 정의는 다음과 같습니다.</p>\r\n");
      out.write("\t\t\t\t\t\t\t\t<ol class=\"sections\">\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li class=\"sections__section\">①\"서비스\"라 함은 구현되는 단말기(PC, TV, 휴대형단말기 등의 각종 유무선 장치를 포함)와 상관없이 \"회원\"이 이용할 수 있는 네이버 및 네이버 관련 제반 서비스를 의미합니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li class=\"sections__section\">②\"회원\"이라 함은 회사의 \"서비스\"에 접속하여 이 약관에 따라 \"회사\"와 이용계약을 체결하고 \"회사\"가 제공하는 \"서비스\"를 이용하는 고객을 말합니다. </li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li class=\"sections__section\">③\"아이디(ID)\"라 함은 \"회원\"의 식별과 \"서비스\" 이용을 위하여 \"회원\"이 정하고 \"회사\"가 승인하는 문자와 숫자의 조합을 의미합니다. </li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li class=\"sections__section\">④\"비밀번호\"라 함은 \"회원\"이 부여 받은 \"아이디와 일치되는 \"회원\"임을 확인하고 비밀보호를 위해 \"회원\" 자신이 정한 문자 또는 숫자의 조합을 의미합니다. </li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li class=\"sections__section\">⑤\"유료서비스\"라 함은 \"회사\"가 유료로 제공하는 각종 온라인디지털콘텐츠(각종 정보콘텐츠, VOD, 아이템 기타 유료콘텐츠를 포함) 및 제반 서비스를 의미합니다. </li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li class=\"sections__section\">⑥\"포인트\"라 함은 서비스의 효율적 이용을 위해 회사가 임의로 책정 또는 지급, 조정할 수 있는 재산적 가치가 없는 \"서비스\" 상의 가상 데이터를 의미합니다. </li>\r\n");
      out.write("\t\t\t\t\t\t\t\t\t<li class=\"sections__section\">⑦\"게시물\"이라 함은 \"회원\"이 \"서비스\"를 이용함에 있어 \"서비스상\"에 게시한 부호ㆍ문자ㆍ음성ㆍ음향ㆍ화상ㆍ동영상 등의 정보 형태의 글, 사진, 동영상 및 각종 파일과 링크 등을 의미합니다. </li>\r\n");
